rm -rf logfile
rm -rf logtime
j=0
for i in $code
do
((j=j+1))
echo $i | egrep -o "https.*WebQuery"
echo $i | egrep -o "https.*WebQuery">>logtime
#echo "------------------------------------------------"
#echo $i >>"logfile_$j"
(time curl -k --connect-timeout 5 -m 5 "$i" >>logfile ) >>logtime 2>&1
done
