sed -i '/--/d' logtime
sed -i '/^sys/d' logtime
sed -i '/^user/d' logtime
sed -i '/^$/d' logtime
awk '/^ht/ {printf "\n%s",$0;next} {printf "%s%s"," ------- ",$0}' logtime  | sed 's/real	//g' >logme
